    function selectAndReplace(message, sender, sendResponse) {
        let imgs = document.querySelectorAll('img');
        const maxImgCount = 3;
        for (imgElt of imgs) {
            let url = imgElt.src;
            var predictedImageUrl = combineImage(url);
            imgElt.src = predictedImageUrl;
            imgElt.srcset = predictedImageUrl;
            maxImgCount--;
            if (maxImgCount <= 0) {
                break;
            }
        }
    
    }
    